import React from 'react';

const Header: React.FC = () => {
  return (
<>
<div style={{ display:"flex" }}>
  
    <Button variant="contained" color="success" style={{backgroundColor:"#294cff", maxHeight:"10vh", justifyContent:'center', margin:'auto'}}>
        Subscribe For Updates
      </Button>
    <div style={{ background: '#f0f0f0', minHeight:'25vh', flex:'1', textAlign:"center"}}>
     <div style={{margin:'10px'}}> William's Blog</div>
    </div>
</div>
</>
  );
};

export default Header;
